    private class MyCustomAdapter extends ArrayAdapter<Coins> {

        private ArrayList<Coins> originalList;
        private ArrayList<Coins> coinList;
        private CountryFilter filter;

        public MyCustomAdapter(Context context, int textViewResourceId,
                               ArrayList<Coins> coinList) {
            super(context, textViewResourceId, coinList);
            this.coinList = new ArrayList<Coins>();
            this.coinList.addAll(coinList);
            this.originalList = new ArrayList<Coins>();
            this.originalList.addAll(coinList);
        }

        @Override
        public Filter getFilter() {
            if (filter == null){
                filter  = new CountryFilter();
            }
            return filter;
        }


        private class ViewHolder {
            TextView coin;
            TextView scoin;
            TextView typecoin;
            TextView urlcoin;
        }

        @Override
        public View getView(int position, View convertView, ViewGroup parent) {

            ViewHolder holder = null;
            Log.v("ConvertView", String.valueOf(position));
            if (convertView == null) {

                LayoutInflater vi = (LayoutInflater)getSystemService(
                        Context.LAYOUT_INFLATER_SERVICE);
                convertView = vi.inflate(R.layout.coin_info, null);

                holder = new ViewHolder();


                holder.coin = (TextView) convertView.findViewById(R.id.coin);
                holder.scoin = (TextView) convertView.findViewById(R.id.scoin);
                holder.typecoin = (TextView) convertView.findViewById(R.id.typecoin);

                convertView.setTag(holder);

            } else {
                holder = (ViewHolder) convertView.getTag();
            }

            Coins coin = coinList.get(position);
            holder.coin.setText(coin.getCoin());
            holder.scoin.setText(" - " + coin.getScoin());
            holder.typecoin.setText(coin.getTypeCoin());


            return convertView;

        }

        private class CountryFilter extends Filter
        {

            @Override
            protected FilterResults performFiltering(CharSequence constraint) {

                constraint = constraint.toString().toLowerCase();
                FilterResults result = new FilterResults();
                if(constraint != null && constraint.toString().length() > 0)
                {
                    ArrayList<Coins> filteredItems = new ArrayList<Coins>();

                    for(int i = 0, l = originalList.size(); i < l; i++)
                    {
                        Coins coin = originalList.get(i);
                        if(coin.toString().toLowerCase().contains(constraint))
                            filteredItems.add(coin);
                    }
                    result.count = filteredItems.size();
                    result.values = filteredItems;
                }
                else
                {
                    synchronized(this)
                    {
                        result.values = originalList;
                        result.count = originalList.size();
                    }
                }
                return result;
            }

            @SuppressWarnings("unchecked")
            @Override
            protected void publishResults(CharSequence constraint,
                                          FilterResults results) {

                coinList = (ArrayList<Coins>)results.values;
                notifyDataSetChanged();
                clear();
                for(int i = 0, l = coinList.size(); i < l; i++)
                    add(coinList.get(i));
                notifyDataSetInvalidated();
            }
        }


    }

















